import * as service from "./auth-service";
import { useState, useEffect } from "react";

const Profile = () => {
  const [profile, setProfile] = useState({});
  useEffect(async () => {
    const user = await service.profile();
    setProfile(user);
  }, []);
  return (
    <div>
      <h4>{profile.username}</h4>
    </div>
  );
};
